INSERT INTO `v1_68c8373c6878d2dd897a7c8507d2debb8c3fe325cb30b6c114628d19e42fc9a3` VALUES ("あうぅ～残念さ～\nマジムンに魂を\n奪われちゃったかな～？", "カオリ（サマー）", 24, 1, 4, 0.0, "2019/07/31 12:00:00", 110501, 10021, 0.0, 0.0, 24015, 4, "2030/12/17 14:59:59");
INSERT INTO `v1_68c8373c6878d2dd897a7c8507d2debb8c3fe325cb30b6c114628d19e42fc9a3` VALUES ("今日は踊りのキレも悪いよ～\nゴーヤーっぽいもの食べて、元気回復さ～！", "カオリ（サマー）", 24, 2, 4, 0.0, "2019/07/31 12:00:00", 110501, 10021, 4.0, 0.0, 24016, 1, "2030/12/17 14:59:59");
INSERT INTO `v1_68c8373c6878d2dd897a7c8507d2debb8c3fe325cb30b6c114628d19e42fc9a3` VALUES ("マジムンだらけで目が回るさ～！\nふらふらさ～！", "カオリ（サマー）", 24, 3, 4, 0.0, "2019/07/31 12:00:00", 110501, 10021, 0.0, 0.0, 24017, 4, "2030/12/17 14:59:59");
INSERT INTO `v1_68c8373c6878d2dd897a7c8507d2debb8c3fe325cb30b6c114628d19e42fc9a3` VALUES ("なんくるない、なんくるない\n次、頑張ればいいんだよ～！\n海で泳いで\nリフレッシュするさー！", "カオリ（サマー）", 24, 4, 1, 0.0, "2019/07/31 12:00:00", 110501, 10021, 5.2, 0.0, 24018, 2, "2030/12/17 14:59:59");
INSERT INTO `v1_68c8373c6878d2dd897a7c8507d2debb8c3fe325cb30b6c114628d19e42fc9a3` VALUES ("恥ずかしいところ\n見られちゃったね～\n水着？　水着のことじゃないよー？", "カオリ（サマー）", 24, 5, 5, 0.0, "2019/07/31 12:00:00", 110501, 10021, 4.2, 0.0, 24019, 6, "2030/12/17 14:59:59");
INSERT INTO `v1_68c8373c6878d2dd897a7c8507d2debb8c3fe325cb30b6c114628d19e42fc9a3` VALUES ("絶好調さ～！　この調子で\n海の平和を取り戻すよ～！\n楽しい夏が待ってるさ～！", "カオリ（サマー）", 24, 6, 2, 0.0, "2019/07/31 12:00:00", 110501, 10021, 0.0, 0.0, 24020, 2, "2030/12/17 14:59:59");
INSERT INTO `v1_68c8373c6878d2dd897a7c8507d2debb8c3fe325cb30b6c114628d19e42fc9a3` VALUES ("何匹で襲ってきたって\n私はマブイを落っことさないよ～！\nくしゅん！　あ……\n今のくしゃみで落っこちたかも～？", "カオリ（サマー）", 24, 7, 1, 0.0, "2019/07/31 12:00:00", 110501, 10021, 6.4, 0.0, 24021, 6, "2030/12/17 14:59:59");
INSERT INTO `v1_68c8373c6878d2dd897a7c8507d2debb8c3fe325cb30b6c114628d19e42fc9a3` VALUES ("ひーやーさーさー♪\n戦いの後は、踊りを踊って\n気分スッキリさ～！", "カオリ（サマー）", 24, 8, 2, 0.0, "2019/07/31 12:00:00", 110501, 10021, 0.0, 0.0, 24022, 2, "2030/12/17 14:59:59");
INSERT INTO `v1_68c8373c6878d2dd897a7c8507d2debb8c3fe325cb30b6c114628d19e42fc9a3` VALUES ("あれ～？　戦ってるうちに\n水着がどっか行っちゃった～？\nねぇキミ、どっかで見なかった～？\nなんで離れるさ～？", "カオリ（サマー）", 24, 9, 6, 0.0, "2019/07/31 12:00:00", 110501, 10021, 10.08, 0.0, 24023, 3, "2030/12/17 14:59:59");
INSERT INTO `v1_68c8373c6878d2dd897a7c8507d2debb8c3fe325cb30b6c114628d19e42fc9a3` VALUES ("まだまだ私は元気だよ～！\nマジムンでもなんでも、\nどんとこーいさー♪", "カオリ（サマー）", 24, 10, 1, 0.0, "2019/07/31 12:00:00", 110501, 10021, 5.0, 0.0, 24024, 2, "2030/12/17 14:59:59");
